import React from 'react';

const ContactCard = (props) => {
    return (
        <div className = "contact-card">
            <img src = "https://placekitten.com/333/200" />
            <h3>Mr. Whiskerson</h3>
            <p>Phone: (212) 555-1234</p>
            <p>Email: mr.whiskerson@catnap.meow</p>
        </div>
    )
}

export default ContactCard
